import React, { useState, useEffect } from 'react'

const Fecth = () => {

    const [users,setUsers]=useState([])

    useEffect(()=>{
        const loadUsers=async()=>{
            const res = await fetch('https://jsonplaceholder.typicode.com/users')
            const data = await res.json()

            setUsers(data)
            console.log(data)
        }
        loadUsers()
    },[])

    
    return (
        <>
            <ul>
                {users.map(item=>(
                    <li key={users.id} >
                    </li>
                ))}
            </ul>
        </>
    )
}

export default Fecth
